const React = require('react');
const Default = require('./Default')

class Index extends React.Component{
    render(){
        const {Product}=this.props;
        return(
            <Default>

                <div class='container'>
                    {Product.map((items, index) => {
                        return (
                            <div class="col-sm-6 col-md-4">
                            <div class="thumbnail" >

                               <a href={`/store/${items._id}`}> <img src={items.img} class="img-responsive fit-image"/></a>
                                <div class="caption">
                                    <div class="row">
                                        <div class="col-md-6 col-xs-6">
                                            <h3>{items.name}</h3>
                                        </div>
                                        <div class="col-md-6 col-xs-6 price">
                                            <h3><label>${items.price}</label></h3>
                                        </div>
                                    </div>
                                    <p>{items.description}</p>
                                    <p> Qty: {items.qty}</p>
                                    <div class="row">

                                        <div class="col-md-6">
                                            { items.qty <1  ? <input  disabled type="submit" class="btn btn-success btn-product" value='OUT OF STOCK' /> :
                                            <form action={`/store/${items._id}/buy?_method=PUT`} method="POST">
                                            <input type="submit" class="btn btn-success btn-product" value='Buy' /> 
                                            </form>
                                            }



                                        </div>
                                    </div>

                                    <p> </p>
                                </div>
                            </div>
                        </div>





                        )
                    })}


            </div>
           </Default>
        )
    }
}

module.exports = Index;

