const React = require('react');
const Default = require('./Default')


class Show extends React.Component{
    render(){
        const {Product}=this.props;
        return(
            <Default>
            <div class='container'> 
             <div class="row">
                    <h1>{Product.name}</h1>
                    <img class='img-responsive showIMG' src={Product.img} alt=""/>
                    <p><h4>{Product.description}</h4></p>

                </div>
                <div class="row">


                    <p><h4>Price: ${Product.price}</h4></p>
                    <p><h4>Qty: {Product.qty}</h4></p>

                    <a href={`/store/${Product._id}/edit`} class="btn btn-primary btn-product"><span class="glyphicon glyphicon-pencil"></span> Edit</a> 

